<script setup lang="ts">
import axios from "axios";
import ProductCard from "@/components/ProductCard.vue";
import { ref, onMounted, computed } from "vue";
import type { Product } from "@/@types/common";

const isLoading = ref(true);
const isSaveButtonLoading = ref(false);
const products = ref<Product[]>([]);

onMounted(async () => {
  try {
    await axios.get("https://httpbin.org/get");
    // データを取得した想定
    products.value = [
      {
        thumbnail:
          "data:image/jpeg;base64,",
      },
    ];

    isLoading.value = false;
  } catch (error) {
    alert("エラーが発生しました");
  }
});

const disabledLeft = computed(() => {
  return (index: number) => {
    return index === 0;
  };
});

const disabledRight = computed(() => {
  return (index: number) => {
    return products.value.length - 1 === index;
  };
});

const productCardsStyle = computed(() => {
  // 180はcard一つの幅、8はマージン
  const marginTotalWidth = (products.value.length - 1) * 8;
  const cardTotalWidth = products.value.length * 180;
  return { width: cardTotalWidth + marginTotalWidth + "px" };
});

const onChangeFiles = async (event: { target: { files: File[] } }) => {
  const promises = Array.from(event.target.files).map((file) =>
    createImage(file)
  );

  const images = await Promise.all(promises);

  images.forEach((image) => {
    products.value.push({
      thumbnail: image,
    });
  });
};

const createImage = async (image: Blob) => {
  const reader = new FileReader();
  reader.readAsDataURL(image);
  return new Promise<string | ArrayBuffer | null>(
    (resolve) =>
      (reader.onload = () => {
        resolve(reader.result);
      })
  );
};

const changeOrder = ({ index, dir }: { index: number; dir: string }) => {
  const productsCopy = products.value.map((list) => ({ ...list }));

  productsCopy.splice(index, 1);

  if (dir === "left") {
    productsCopy.splice(index - 1, 0, products.value[index]);
  } else {
    productsCopy.splice(index + 1, 0, products.value[index]);
  }

  products.value = productsCopy;
};

const deleteItem = (index: number) => {
  products.value.splice(index, 1);
};

const saveItems = async () => {
  const result = window.confirm("保存しますか？");
  if (!result) return;

  try {
    isSaveButtonLoading.value = true;
    await axios.post("https://httpbin.org/post", {
      items: products.value,
    });
  } catch (error) {
    alert("エラーが発生しました");
  } finally {
    isSaveButtonLoading.value = false;
  }
};
</script>

<template>
  <div class="img-uploader">
    <div class="img-uploader-title">商品写真</div>
    <div class="img-uploader-content">
      <div v-if="isLoading" class="spinner" />
      <div v-else>
        <label class="button-icon">
          <input
            type="file"
            name="thumbnail"
            accept="image/png, image/jpeg"
            multiple
            @change="onChangeFiles"
          />
          <span><mdicon name="plus" :width="18" :height="18" /></span>
          <span>ファイルを選択する</span>
        </label>
        <div class="product-cards-wrap">
          <div class="product-cards" :style="productCardsStyle">
            <template v-for="(product, index) in products" :key="index">
              <product-card
                class="card"
                :product-detail="product"
                :index="index"
                :disabled-left="disabledLeft(index)"
                :disabled-right="disabledRight(index)"
                @deleteItem="deleteItem"
                @changeOrder="changeOrder"
              />
            </template>
          </div>
        </div>
        <button
          class="save-button"
          @click="saveItems"
          :disabled="isSaveButtonLoading"
        >
          <span v-if="isSaveButtonLoading" class="spinner" />
          <span v-else>保存</span>
        </button>
      </div>
    </div>
  </div>
</template>

